// src/App.tsx
import React from 'react';
import NewsArticle from './NewsArticle';
import WorksCited from './Works-cited'
import Navbar from './Navbar';
import AppRouter from './AppRouter';
const App: React.FC = () => {
  return (
    <div className="App">
      <Navbar/>
      <AppRouter/>
      <NewsArticle />
      <WorksCited />
    </div>
  );
};

export default App;
